import React from "react";
import { add, min, mul, div } from "./Cal";



function App(){
    return <>
    <h1> {add(6,5)} </h1>
    <h1> {min(6,5)} </h1>
    <h1> {mul(6,5)} </h1>
    <h1> {div(6,30)} </h1>



</>
}

export default App;
